import React from "react";
import Clock from "react-live-clock";

const ClockComponent = () => {
  return (
    <div className="clock">
      <Clock
        className="custom-clock"
        format={"HH:mm"}
        ticking={true}
        timezone={"Asia/Seoul"}
      />
    </div>
  );
};

export default ClockComponent;
